import Vue from "vue";
import Router from "vue-router";
import Home from "./views/Home.vue";
import Contact from "./views/Contact.vue";
import AccidentCheck from "./views/Accidentcheck.vue";

Vue.use(Router);

export default new Router({
  routes: [
    {
      path: "/",
      name: "home",
      component: Home
    },
    {
      path: "/contact",
      name: "contact",
      component: Contact
    },
    {
      path: "/tools/accident-check",
      name: "accident-check",
      component: AccidentCheck
    },
    {
      path: "/tools/trade-in",
      name: "trade-in",
      component: TradeIn
    },
    {
      path: "/tools/insurance",
      name: "insurance",
      component: Insurance
    },
    {
      path: "/tools/credit",
      name: "credit",
      component: Credit
    },
    {
      path: "/tools/reserve-now",
      name: "reserve-now",
      component: ReserveNow
    },
    {
      path: "/tools/reviews",
      name: "reviews",
      component: Reviews
    },
    {
      path: "/tools/total-loss",
      name: "total-loss",
      component: TotalLoss
    }
  ]
});
